					visibleScale[visibleCount] = new sap.gantt.misc.AxisTime(timeRangeSet[t].range, viewRangeSet[t], this.zoomRate, this.zoomOrigin, this.viewOffset, null, this.RTL).scale;
					visibleCount++;
